def remove_html_tags(text):
    # Rremoves the html tag from a string
    import re
    clean = re.compile('<.*?>')
    return re.sub(clean, '', text)

def prepare_text(raw_text):
    raw_text = raw_text.replace(".", "")
    raw_text = raw_text.replace("-", "")
    raw_text = raw_text.replace("\'", "")
    raw_text = raw_text.replace("\"", "")
    raw_text = raw_text.replace(",", "")
    raw_text = raw_text.replace("!", "")
    raw_text = raw_text.replace("(", " ")
    raw_text = raw_text.replace(")", " ")
    raw_text = raw_text.replace("/", " ")
    raw_text = raw_text.replace("*", " ")
    raw_text = raw_text.replace("$", " ")
    raw_text = raw_text.replace(":", " ")
    raw_text = raw_text.replace("¬£", " ")
    raw_text = raw_text.replace("\n", " ")
    raw_text = raw_text.lower()

    raw_text = re.sub(' +', ' ', raw_text)
    raw_text = raw_text.strip()

    raw_text = raw_text.split(" ")

    # Cleaned text removing the text not in the dictorinaries
    text = raw_text[:]
    text = text[1:]
    for word in raw_text:
        if word not in weight_dict:
            text.remove(word)
    return text


def use_model(string):
    string = remove_html_tags(string)
    rating = 0
    for word in prepare_text(string):
        print(weight_dict[word])
        rating += weight_dict[word]
    # Pass through a sigmoud function
    # We dont need to use the sigmond function anymore
    if rating > 2:
        return 100
    elif rating < -2:
        return 0

    rating = 1 / (1 + math.exp(-rating))
    return int(round(rating * 100, 0))
